
DROP DATABASE IF EXISTS JobsConnected;
CREATE DATABASE JobsConnected;
USE JobsConnected;



DROP TABLE Booth;
CREATE TABLE Booth(
   ScreenName VARCHAR(36) 
  ,Email VARCHAR(39) 
  ,Minutes VARCHAR(7)
  ,BoothName VARCHAR(39) 
);



DROP TABLE Registration;
CREATE TABLE Registration(
   Date_Submitted                           VARCHAR(37)   
  ,First_Name                               VARCHAR(12) 
  ,Last_Name                                VARCHAR(25) 
  ,Full_Name                                VARCHAR(31) 
  ,Email                                    VARCHAR(37) 
  ,I_am_a                                   VARCHAR(17)
  ,Class_Year                               VARCHAR(9) 
  ,Major                                    VARCHAR(97) 
  ,What_are_your_reasons_for_participating  VARCHAR(151) 
);


